-- Create tables and sequences

CREATE TABLE "Authors" (
    id integer NOT NULL,
    "First Name" text,
    "Last Name" text,
    "Website" mathesar_types.uri
);

CREATE SEQUENCE "Authors_id_seq"
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE "Authors_id_seq" OWNED BY "Authors".id;


CREATE TABLE "Books" (
    id integer NOT NULL,
    "Title" text,
    "Publication Year" integer,
    "Media" text,
    "Page Count" integer,
    "LC Classification" text,
    "ISBN" text,
    "Dewey Decimal" text,
    "Dewey Wording" text,
    "Author" integer,
    "Publisher" integer
);

CREATE SEQUENCE "Books_id_seq"
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE "Books_id_seq" OWNED BY "Books".id;


CREATE TABLE "Checkouts" (
    id integer NOT NULL,
    "Item" integer,
    "Patron" integer,
    "Checkout Time" timestamp without time zone NOT NULL,
    "Due Date" date NOT NULL,
    "Check In Time" timestamp without time zone
);

CREATE SEQUENCE "Checkouts_id_seq"
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE "Checkouts_id_seq" OWNED BY "Checkouts".id;


CREATE TABLE "Items" (
    id integer NOT NULL,
    "Barcode" text,
    "Acquisition Date" date,
    "Acquisition Price" mathesar_types.mathesar_money,
    "Book" integer
);

CREATE SEQUENCE "Items_id_seq"
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE "Items_id_seq" OWNED BY "Items".id;


CREATE TABLE "Media" (
    id integer NOT NULL,
    "Type" text
);

CREATE SEQUENCE "Media_id_seq"
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE "Media_id_seq" OWNED BY "Media".id;


CREATE TABLE "Patrons" (
    id integer NOT NULL,
    "First Name" text,
    "Last Name" text,
    "Email" mathesar_types.email
);

CREATE SEQUENCE "Patrons_id_seq"
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE "Patrons_id_seq" OWNED BY "Patrons".id;


CREATE TABLE "Publishers" (
    id integer NOT NULL,
    "Name" text
);

CREATE SEQUENCE "Publishers_id_seq"
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE "Publishers_id_seq" OWNED BY "Publishers".id;


-- Add default sequencing to tables

ALTER TABLE ONLY "Authors" ALTER COLUMN id SET DEFAULT nextval('"Authors_id_seq"'::regclass);
ALTER TABLE ONLY "Books" ALTER COLUMN id SET DEFAULT nextval('"Books_id_seq"'::regclass);
ALTER TABLE ONLY "Checkouts" ALTER COLUMN id SET DEFAULT nextval('"Checkouts_id_seq"'::regclass);
ALTER TABLE ONLY "Items" ALTER COLUMN id SET DEFAULT nextval('"Items_id_seq"'::regclass);
ALTER TABLE ONLY "Media" ALTER COLUMN id SET DEFAULT nextval('"Media_id_seq"'::regclass);
ALTER TABLE ONLY "Patrons" ALTER COLUMN id SET DEFAULT nextval('"Patrons_id_seq"'::regclass);
ALTER TABLE ONLY "Publishers" ALTER COLUMN id SET DEFAULT nextval('"Publishers_id_seq"'::regclass);


